    "2016-07-27T22:22:08.617432",nt"name": "tewaukon-national-wildlife-refuge-narrative-report-for-september-october-november-december",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Tewaukon National
    Wildlife Refuge summarizes refuge activities from September through December of
    1957.  The report begins with a summary of the weather and habitat conditions during
    this period.  Wildlife- including migratory birds, upland game birds, big game animals,
    fur animals, predacious birds, fish, and reptiles- is also covered.  The report
    includes a refuge development and maintenance section which discusses physical developments,
    plantings, collections, receipts, control of vegetation, and fires.  Resource management
    is outlined; haying, fur harvest, and commercial fishing were the primary resources
    used during this period.  A progress report on field investigation and applied research
    is also provided.  The public relations section of the report discusses recreational
    uses of the refuge, refuge visitors, refuge participation, hunting, and violations.
     Finally, items of interest, information on easements and WPAs, and N-R forms are
